An StructOverlay is a special Lua type that allows access to the memory of a structure. It has index and newindex metamethods that access to the members of the structure seamlessly, with no magic numbers/offsets, completely externally*. * This is not true if using luagenny outside of regenny. By default it operates on memory as if it was in the same context as the current process. regenny overrides luagenny's read and write functions to read and write from the target process. Example assuming Foo is: struct Foo { int a; int b;
}; local sdk = regenny:sdk() -- in another application, this would be different.
local overlay = sdkgenny.StructOverlay(0xdeadbeef, sdk:global_ns():find_type("Foo"))
overlay.a = 123
overlay.b = 456

3.body:
// Explicitly defined types.
// Format is type {type_name} {type_size} [[{metadata}]]
// the metadata determines how the type is displayed in the GUI and read by the Lua API.
type int 4 [[i32]]
type float 4 [[f32]]
type char 1 // Forward declared structure.
struct Bar{}; // Simple structure. Size is explicitly defined. It doesn't need to be, though.
struct Foo 0x100 { int a @ 4 // Explicit offset char* b @ 8 [[utf8*]] int c // implicit offset, it's 0x10, inferred from the previous member int d @ 0x70 float e @ 0x80 Bar* bar @ 0x90 // Pointer to a forward declared structure
}; struct Bar { Foo* parent int b int c
}; rexample The above image is slightly out of date. There is no longer a text editor inside ReGenny itself. .genny files must be opened within ReGenny and edited with an external text editor now. Reason being ImGui's text editor functionality was not that great and caused frustrating issues.

