Foo.hpp #pragma once
struct Bar;
#pragma pack(push, 1)
struct Foo { char pad_0[0x4]; int a; // 0x4 // Metadata: utf8* char* b; // 0x8 int c; // 0x10 char pad_14[0x5c]; int d; // 0x70 char pad_74[0xc]; float e; // 0x80 char pad_84[0xc]; Bar* bar; // 0x90 char pad_98[0x68];
}; // Size: 0x100
#pragma pack(pop) Bar.hpp #pragma once
struct Foo;
#pragma pack(push, 1)
struct Bar { Foo* parent; // 0x0 int b; // 0x8 int c; // 0xc
}; // Size: 0x10
#pragma pack(pop)

7.body:
Types and variables can have a metadata attached to them. This metadata is used to determine how the type is displayed in the GUI and read by the Lua API. For types, the format is type {type_name} {size} [[{metadata}]]. For variables, the format is {type_name} {variable_name} [[{metadata}]]. Example: type int 4 [[i32]] // i32 metadata, will be displayed as a signed 32-bit integer in the GUI
type float 4 [[f32]] // f32 metadata, will be displayed as a 32-bit float in the GUI
type char 1 // no metadata struct Foo { // will be displayed as a signed 32-bit integer in the GUI, implicit metadata int a; // utf8* metadata, will be displayed as a utf8 string in the GUI // must be explicitly specified, as the type is a pointer to 1 byte char* b [[utf8*]] // f32 metadata, will be displayed as a 32-bit float in the GUI float c // metadata does not need to be specified for this pointer int* d
};
